import { NavLink } from 'react-router-dom';
import s from './../Dialogs.module.css'


const DialogItem = (props) => {
    return (
            <NavLink className={s.dialog} to={`/dialogs/${props.id}`}>{props.name}</NavLink>
    )
}


export default DialogItem;
